{"code": "import requests
import json

# Get all projects
response = requests.get(
    "http://the-agent-company.com:8929/api/v4/projects",
    auth=("root", "theagentcompany")
)

if response.status_code == 200:
    projects = response.json()
    for project in projects:
        if "docs-template-repo" in project.get("name", ""):
            print(f"Found project: {project['name']}")
            print(f"Project ID: {project['id']}")
            print(f"Visibility: {project.get('visibility', 'unknown')}")
            print(f"Path with namespace: {project.get('path_with_namespace', 'unknown')}")
            break
else:
    print(f"Error: {response.status_code}")
    print(response.text)"}

