{"command": "curl -s "http://the-agent-company.com:8929/api/v4/projects?owned=true&per_page=100" \
  --user "root:theagentcompany" > /tmp/projects.json && python3 -c "
import json
with open('/tmp/projects.json') as f:
    projects = json.load(f)
    for p in projects:
        if 'docs' in p.get('name', '').lower() or 'template' in p.get('name', '').lower():
            print(f\"Name: {p['name']}, ID: {p['id']}, Path: {p.get('path_with_namespace', 'N/A')}, Visibility: {p.get('visibility', 'N/A')}\")
""}

